import React from "react";
import { Text, Accordion, Center } from "@mantine/core";

const BrandList = ({
  setBoxVisible,
  boxVisible,
  setBoxVisible2,
  boxVisible2,
  setBoxVisible3,
  boxVisible3,
  setBoxVisible4,
  boxVisible4,
}) => {
  
  return (
    <Accordion.Item value="brand-list">
      <Accordion.Control bg="indigo.2">
        <Center>
          <Text fw={700}>Brand List</Text>
        </Center>
      </Accordion.Control>
      <Accordion.Panel>Content</Accordion.Panel>
    </Accordion.Item>
  );
};

export default BrandList;
